// 百度地图API功能
var map = new BMap.Map("allmap");            // 创建Map实例
map.centerAndZoom(new BMap.Point(120.277342,36.387564),10);  //初始化时，即可设置中心点和地图缩放级别。
map.enableScrollWheelZoom();
map.addControl(new BMap.ScaleControl({anchor: BMAP_ANCHOR_BOTTOM_LEFT}));                    // 左下
map.addControl(new BMap.NavigationControl({anchor: BMAP_ANCHOR_TOP_LEFT}));  //右上角，仅包含平移和缩放按钮
map.addControl(new BMap.MapTypeControl({mapTypes: [BMAP_NORMAL_MAP,BMAP_HYBRID_MAP]}));     //2D图，卫星图



var polygonOptDistricts = {strokeWeight: 2, strokeColor: "#6666ee", fillColor:"", strokeStyle: "dashed"};

function getBoundary(){       
    var bdary = new BMap.Boundary();
    bdary.get("青岛", function(rs){       //获取行政区域
        var count = rs.boundaries.length; //行政区域的点有多少个
        for(var i = 0; i < count; i++){
            var ply = new BMap.Polygon(rs.boundaries[i], polygonOptDistricts); //建立多边形覆盖物
            map.addOverlay(ply);  //添加覆盖物
        }                
    });   
   
}
setTimeout(function(){
    getBoundary();
}, 1500);
